import React from "react";
import TextField from "@material-ui/core/TextField";
import logo from "./logo.svg";
import "./App.css";

function App() {
  return (
    <div className="App">
      <TextField
        id="outlined-multiline-static"
        label="Multiline"
        multiline
        rows="4"
        defaultValue="Default Value"
        variant="outlined"
      />
    </div>
  );
}

export default App;
